The '''AQM-128''' was a short-lived program undertaken by the [[United States Navy]] for the development of a subscale [[target drone]], launched from aircraft and capable of supersonic speed.<ref>Grossnick 1997, p.671.</ref> The AQM-128 was intended to use pre-programmed guidance.<ref name="DS">Parsch 2002</ref>

The program for development of the new target drone was begun in 1983; in January 1984, the designation YAQM-128A was approved for the program.<ref name="DS"/> However, the program was cancelled in April that year before any designs were selected.<ref name="DS">Parsch 2002</ref>

